// Contacts.js
import React from 'react';
import style from './style.module.css'; // Create a CSS module for styling

const Contacts = () => {
  return (
    <div className={style.contacts}>
      <h1>Contact Me</h1>
      <p>Feel free to reach out to me at:</p>
      <ul>
        <li>Email: yourname@example.com</li>
        <li>LinkedIn: <a href="https://linkedin.com/in/yourprofile">LinkedIn Profile</a></li>
        <li>GitHub: <a href="https://github.com/yourusername">GitHub Profile</a></li>
      </ul>
    </div>
  );
};

export default Contacts;
